proxy-groups:
  - name: Foreign agents
    type: select
    disable-udp: true
    proxies:
      - CF-Warp
      - FallBack
      - Load Balancer
      - Remote

  - name: Remote
    type: load-balance
    proxies:
      - FallBack
      - Load Balancer
      - CF-Warp
    url: https://lab.skk.moe/test-204
    interval: "10"
    disable-udp: true
    strategy: consistent-hashing  # round-robin 随机连接
    
  - name: FallBack
    type: fallback
    disable-udp: true
    include-all-proxies: true
    include-all-providers: true
    use:
    url: https://lab.skk.moe/test-204
    'interval': "18"


  - name: CF-Warp
    type: url-test
    disable-udp: true
    include-all-proxies: true
    include-all-providers: true
    use:
    url: https://lab.skk.moe/test-204
    'interval': "30"

      
  - name: Domestic direct
    type: select
    disable-udp: true
    include-all-proxies: true
    include-all-providers: true
    proxies:
      - DIRECT
      - Foreign agents
      - FallBack
      - Load Balancer
      
  - name: Load Balancer
    type: load-balance
    include-all-proxies: true
    include-all-providers: true
    use:
    url: https://lab.skk.moe/test-204
    interval: "10"
    disable-udp: true
    strategy: round-robin
    # consistent-hashing 同域名同连接
    # round-robin 随机连接


rule-providers:
  Local:
    type: http
    behavior: classical
    path: ./Rule-Providers/Local.list
    url: https://cdn.jsdelivr.net/gh/LittleRey/clash-yaml/rules/Local.list
    'interval': "3600"

  Proxy:
    type: http
    behavior: classical
    path: ./Rule-Providers/Proxy.list
    url: https://cdn.jsdelivr.net/gh/LittleRey/clash-yaml/rules/Proxy.list
    'interval': "3600"

  UnBlock:
    type: http
    behavior: classical
    path: ./Rule-Providers/UnBlock.list
    url: https://cdn.jsdelivr.net/gh/LittleRey/clash-yaml/rules/UnBlock.list
    'interval': "3600"

  Direct:
    type: http
    behavior: classical
    path: ./Rule-Providers/Direct.list
    url: https://cdn.jsdelivr.net/gh/LittleRey/clash-yaml/rules/Direct.list
    'interval': "3600"
  block:
    type: http
    behavior: domain
    url: https://cdn.jsdelivr.net/gh/Loyalsoldier/clash-rules@release/reject.txt
    path: ./ruleset/block.yaml
    interval: "3600"
rules:
 - DOMAIN-SUFFIX,googlesyndication.com,Foreign agents
 - AND,((GEOSITE,category-ads-all),(NOT,((DOMAIN-SUFFIX,googlesyndication.com)))),REJECT
 - GEOSITE,category-ads-all,REJECT
 - RULE-SET,block,REJECT
 - AND,((NETWORK,TCP),(DST-PORT,5228-5230)),Foreign agents
 - AND,((NETWORK,TCP),(DST-PORT,5228-5230),(OR,((DOMAIN-KEYWORD,google)))),Foreign agents
 - AND,((NETWORK,udp),(OR,((DST-PORT,443/80),(GEOSITE,GOOGLE)))),REJECT
 - AND,((NETWORK,udp),(GEOSITE,google)),REJECT
 - AND,((NETWORK,udp),(OR,((DST-PORT,443/80),(GEOSITE,youtube)))),REJECT
 - AND,((NETWORK,udp),(GEOSITE,youtube)),REJECT
 - IP-CIDR,127.0.0.1/32,REJECT,no-resolve
 - IP-CIDR,198.18.0.1/16,REJECT,no-resolve
 - IP-CIDR,28.0.0.1/8,REJECT,no-resolve
 - IP-CIDR6,::1/128,REJECT,no-resolve
 - GEOIP,telegram,Foreign agents
 - GEOSITE,telegram,Foreign agents
 - AND,((NETWORK,UDP),(DST-PORT,123)),Foreign agents
 - DST-PORT,123/136/137-139,Foreign agents,udp
 - AND,((PROCESS-NAME,clash),(NOT,((IN-TYPE,inner)))),REJECT
 - IN-TYPE,inner,Foreign agents
 - RULE-SET,Local,Domestic direct
 - RULE-SET,Direct,Domestic direct
 - RULE-SET,Proxy,Foreign agents
 - AND,((RULE-SET,UnBlock),(GEOIP,google)),Foreign agents
 - RULE-SET,UnBlock,Foreign agents
 - GEOIP,IR,Domestic direct
 - MATCH,Foreign agents
